  const contentStyle = {
    height: '160px',
    color: 'black',
    lineHeight: '160px',
    textAlign: 'center',
    background: '#364d79',
  };
  function onChange(a, b, c) {
    console.log(a, b, c);
  }
  return (
    <Carousel afterChange={onChange}>
    <div >
      <img  src={bg1} alt="shop" style={contentStyle}/>1
    </div>
    <div>
    <img  src={bg1} alt="shop" style={contentStyle}/>1

    </div>
   
   
  </Carousel>
    
  )
}

export default HeroCarosel
